import { Works } from "../data"

const WorkPreview = () => {
  return (
    <div className="h-20 w-full">
    <h1 className="font-futura">See also:</h1>
    {Works.map((workItem) => {
        return (
            <h1>{workItem.title}</h1>
        )
    })}
    </div>
  )
}
export default WorkPreview
